import React from 'react';
import './editForm.css';
import FormForAddAndEditProduct from '../formForAddOrEditProduct/Form';


const EditForm = ({state, form}) => {
    return (
        <div className="editForm" ref={form}>
            <FormForAddAndEditProduct
                initState={state}
                // handleSubmit={} 
            />
            <button 
                type="reset" 
                className="resetFormButton"
                onClick={() => {
                    console.log(form.current.values)
                }}
            >
                RESET
            </button>
            <button 
                type="cancel" 
                className="cancelChangesButton"
                onClick={() => {
                    form.current.style.display = ''
                }}
            >
                CANCEL
            </button>
        </div>
    )
}

export default EditForm;
